func testLoadBalancerToManyAssignments(t *testing.T) {
	var err error
	ctx := context.Background()
	tx := MustTx(boil.BeginTx(ctx, nil))
	defer func() { _ = tx.Rollback() }()

	var a LoadBalancer
	var b, c Assignment

	seed := randomize.NewSeed()
	if err = randomize.Struct(seed, &a, loadBalancerDBTypes, true, loadBalancerColumnsWithDefault...); err != nil {
		t.Errorf("Unable to randomize LoadBalancer struct: %s", err)
	}

	if err := a.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}

	if err = randomize.Struct(seed, &b, assignmentDBTypes, false, assignmentColumnsWithDefault...); err != nil {
		t.Fatal(err)
	}
	if err = randomize.Struct(seed, &c, assignmentDBTypes, false, assignmentColumnsWithDefault...); err != nil {
		t.Fatal(err)
	}

	queries.Assign(&b.LoadBalancerID, a.LoadBalancerID)
	queries.Assign(&c.LoadBalancerID, a.LoadBalancerID)
	if err = b.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}
	if err = c.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}

	check, err := a.Assignments().All(ctx, tx)
	if err != nil {
		t.Fatal(err)
	}

	bFound, cFound := false, false
	for _, v := range check {
		if queries.Equal(v.LoadBalancerID, b.LoadBalancerID) {
			bFound = true
		}
		if queries.Equal(v.LoadBalancerID, c.LoadBalancerID) {
			cFound = true
		}
	}

	if !bFound {
		t.Error("expected to find b")
	}
	if !cFound {
		t.Error("expected to find c")
	}

	slice := LoadBalancerSlice{&a}
	if err = a.L.LoadAssignments(ctx, tx, false, (*[]*LoadBalancer)(&slice), nil); err != nil {
		t.Fatal(err)
	}
	if got := len(a.R.Assignments); got != 2 {
		t.Error("number of eager loaded records wrong, got:", got)
	}

	a.R.Assignments = nil
	if err = a.L.LoadAssignments(ctx, tx, true, &a, nil); err != nil {
		t.Fatal(err)
	}
	if got := len(a.R.Assignments); got != 2 {
		t.Error("number of eager loaded records wrong, got:", got)
	}

	if t.Failed() {
		t.Logf("%#v", check)
	}
}

